import EmployeeSetupService from "../../service/setup/EmployeeSetupService";
import CommonService from "../../service/CommonService";
import CompanySetupService from "../../service/setup/CompanySetupService";
import BranchSetupService from "../../service/setup/BranchSetupService";
import DepartmentSetupService from "../../service/setup/DepartmentSetupService";
import DesignationSetupService from "../../service/setup/DesignationSetupService";
import JobTypeSetupService from "../../service/setup/JobTypeSetupService";
import RoleSetupService from "../../service/security/RoleSetupService";
import UserSetupService from "../../service/security/UserSetupService";
import Validation from "../../scripts/validation";
import moment from "moment";
import { FilterMatchMode, FilterOperator } from "primevue/api";
import SetupReportService from "../../service/report/SetupReportService";
import ConsultantDegreeSetupService from "../../service/setup/ConsultantDegreeSetupService";

export default {
  data() {
    return {
      isEmailValid: "",
      isPhoneValid: "",
      newInfo: false,
      dataList: true,
      active: 0,
      filters: {
        global: { value: null, matchMode: FilterMatchMode.CONTAINS },
        name: { value: null, matchMode: FilterMatchMode.STARTS_WITH },
      },
      initFilters() {
        this.filters = {
          global: { value: null, matchMode: FilterMatchMode.CONTAINS },
          name: {
            operator: FilterOperator.AND,
            constraints: [
              { value: null, matchMode: FilterMatchMode.STARTS_WITH },
            ],
          },
        };
      },
      employeeList: [],
      employeeSetup: {
        active: false,
        _createUser: false,
      },
      submitted: false,
      genderList: [],
      companyList: [],
      branchList: [],
      departmentList: [],
      designationList: [],
      jobtypeList: [],
      roleList: [],
      usersList: [],
      consultantDegreeList: [],
    };
  },

  created() {
    this.employeeSetupService = new EmployeeSetupService();
    this.commonService = new CommonService();
    this.companySetupService = new CompanySetupService();
    this.branchSetupService = new BranchSetupService();
    this.departmentSetupService = new DepartmentSetupService();
    this.designationSetupService = new DesignationSetupService();
    this.jobTypeSetupService = new JobTypeSetupService();
    this.roleSetupService = new RoleSetupService();
    this.userSetupService = new UserSetupService();
    this.validation = new Validation();
    this.setupReportService = new SetupReportService();
    this.consultantDegreeSetupService = new ConsultantDegreeSetupService();


    this.employeeSetupService
      .getAll()
      .then((data) => (this.employeeList = data.data));

    this.commonService.GetAllGender().then(
      (data) =>
        (this.genderList = data.data)
    );

    this.companySetupService
      .getAll()
      .then((data) => (this.companyList = data.data));

    this.branchSetupService
      .getAll()
      .then((data) => (this.branchList = data.data));

    this.departmentSetupService
      .getAll()
      .then((data) => (this.departmentList = data.data));

    this.designationSetupService
      .getAll()
      .then((data) => (this.designationList = data.data));

    this.jobTypeSetupService
      .getAll()
      .then((data) => (this.jobtypeList = data.data));

    this.roleSetupService.getAll().then((data) => (this.roleList = data.data));
    this.userSetupService.getAll().then((data) => (this.usersList = data.data));

    this.consultantDegreeSetupService
      .getAll()
      .then((data) => (this.consultantDegreeList = data.data));
  },
  methods: {
    printAll() {
      this.setupReportService.GetHospitalEmployeeList(this).then((data) => (this.commonService.Downloadfile(data.data)));
    },
    openNew() {
      this.isEmailValid = "";
      this.isPhoneValid = "";
      this.employeeSetup = {
        active: false,
        _createUser: false,
      };
      this.active = 0;
      this.newInfo = true;
      this.dataList = false;
      this.submitted = false;
    },
    hideNew() {
      this.isEmailValid = "";
      this.isPhoneValid = "";
      this.employeeSetup = {
        active: false,
        _createUser: false,
      };
      this.dataList = true;
      this.newInfo = false;
      this.submitted = false;
    },
    isPhoneValidAndExists() {
      this.validation.isPhoneValidAndExists(this.employeeList, 'contact_no', this.employeeSetup.contact_no, 'employee_id', this.employeeSetup.employee_id, this)
    },
    isEmailValidAndExists() {
      this.validation.isEmailValidAndExists(this.employeeList, 'email', this.employeeSetup.email, 'employee_id', this.employeeSetup.employee_id, this
      );
      this.validation.isEmailValidAndExists(this.usersList, 'email', this.employeeSetup.email, '', '', this
      );
      this.validation.isEmailValidAndExists(this.usersList, 'user_name', this.employeeSetup.email, '', '', this
      );
    },
    async add() {
      this.submitted = true;
      try {
        if (!this.employeeSetup.first_name) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.last_name) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.cdbirth_date) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.gender) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.contact_no) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.email) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.company_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.branch_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.department_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.designation_id) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.jobtypeid) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (
          !this.employeeSetup._role_id &&
          this.employeeSetup._createUser
        ) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (!this.employeeSetup.cdjoin_date) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (
          !this.employeeSetup._password &&
          this.employeeSetup._createUser
        ) {
          this.$toast.add({
            severity: "error",
            summary: "Error",
            detail: "Please fill in the required fields",
            life: 10000,
          });
          return;
        } else if (this.isPhoneValid || this.isEmailValid) {
          return;
        } else {
          this.employeeSetup.birth_date = moment(
            String(this.employeeSetup.cdbirth_date)
          ).format("YYYY-MM-DD");
          this.employeeSetup.join_date = moment(
            String(this.employeeSetup.cdjoin_date)
          ).format("YYYY-MM-DD");
          if(!this.employeeSetup.ipd_commission_rate){
            this.employeeSetup.ipd_commission_rate = "0";
          }
          if(!this.employeeSetup.opd_commission_rate){
            this.employeeSetup.opd_commission_rate = "0";
          }
          if (!this.employeeSetup.employee_id) {
            let result = await this.employeeSetupService.add(
              this.employeeSetup
            );
            if (result.status === 201) {
              this.$toast.add({
                severity: "success",
                summary: "Success",
                detail: "Successfully Created",
                life: 10000,
              });
              this.hideNew();
              this.employeeSetupService
                .getAll()
                .then((data) => (this.employeeList = data.data));
            } else if (result.status === 401) {
              this.$toast.add({
                severity: "error",
                summary: "Error",
                detail: "Email already Used",
                life: 10000,
              });
            } else {
              this.$toast.add({
                severity: "error",
                summary: "Failed",
                detail: result.res,
                life: 10000,
              });
            }
          } else {
            if (!this.employeeSetup._createUser) {
              this.employeeSetup._createUser = false;
            }
            let result = await this.employeeSetupService.put(
              this.employeeSetup,
              this.employeeSetup.employee_id
            );
            if (result.status === 202) {
              this.$toast.add({
                severity: "success",
                summary: "Success",
                detail: "Updated Successfully",
                life: 10000,
              });
              this.hideNew();
              this.employeeSetupService
                .getAll()
                .then((data) => (this.employeeList = data.data));
            } else if (result.status === 401) {
              this.$toast.add({
                severity: "error",
                summary: "Error",
                detail: result.data,
                life: 10000,
              });
            } else {
              this.$toast.add({
                severity: "error",
                summary: "Failed",
                detail: result.res,
                life: 10000,
              });
            }
          }
        }
      } catch (error) {
        this.$toast.add({
          severity: "error",
          summary: "Failed",
          detail: error,
          life: 10000,
        });
      }
    },
    edit(obj) {
      this.employeeSetup = Object.assign({}, obj);
      this.employeeSetup.company_id = obj.company_id;
      this.employeeSetup.branch_id = obj.branch_id;
      this.employeeSetup.department_id = obj.department_id;
      this.employeeSetup.designation_id = obj.designation_id;
      this.employeeSetup.jobtypeid = obj.jobtypeid;
      this.employeeSetup.role_id = obj.role_id;
      this.employeeSetup.cdbirth_date = moment(
        String(this.employeeSetup.birth_date)
      ).format("MM/DD/YYYY");
      this.employeeSetup.cdjoin_date = moment(
        String(this.employeeSetup.join_date)
      ).format("MM/DD/YYYY");

      this.dataList = false;
      this.newInfo = true;
    },
    formatDate(value) {
      return moment(String(value)).format("MM/DD/YYYY");
    },
  },
};
